import React, { useState } from "react";
import {
  NavbarContainer,
  LeftContainer,
  RightContainer,
  NavbarExtendedContainer,
  NavbarInnerContainer,
  NavbarLinkContainer,
  NavbarLink,
  Logo,
  OpenLinksButton,
  NavbarLinkExtended,
} from "./NavBar.styles";
import LogoImg from "../../assets/images/conquer-logo-1.png";

const Navbar = () => {
  const [extendNavbar, setExtendNavbar] = useState(false);

  return (
    <NavbarContainer extendNavbar={extendNavbar}>
      <NavbarInnerContainer>
        <LeftContainer>
          <NavbarLinkContainer>
          <NavbarLink to='/escape-rooms'>Escape Rooms</NavbarLink>
        <OptionLink to='/special-events'>Special Events</OptionLink>
        <OptionLink to='/birthday-parties'>Birthday Parties</OptionLink>
        <OptionLink to='/corporate-events'>Corporate Events</OptionLink>
        <OptionLink to='/faq'>FAQs</OptionLink>
        <OptionLink to='/hours'>Hours</OptionLink>
        <OptionLink to='/gallery'>Gallery</OptionLink>
        <a href='https://airmadnesspos.com/airmadness/onlinewaiver/waiver.php'>Waiver</a>
        <OptionLink to='/reviews'>Reviews</OptionLink>
        <OptionLink to='/contact'>Contact</OptionLink>
            <NavbarLink to="/"> Home</NavbarLink>
            <NavbarLink to="/products"> Products</NavbarLink>
            <NavbarLink to="/contact"> Contact Us</NavbarLink>
            <NavbarLink to="/about"> About Us</NavbarLink>
            <OpenLinksButton
              onClick={() => {
                setExtendNavbar((curr) => !curr);
              }}
            >
              {extendNavbar ? <>&#10005;</> : <> &#8801;</>}
            </OpenLinksButton>
          </NavbarLinkContainer>
        </LeftContainer>
        <RightContainer>
          <Logo src={LogoImg}></Logo>
        </RightContainer>
      </NavbarInnerContainer>
      {extendNavbar && (
        <NavbarExtendedContainer>
          <NavbarLinkExtended to="/"> Home</NavbarLinkExtended>
          <NavbarLinkExtended to="/products"> Products</NavbarLinkExtended>
          <NavbarLinkExtended to="/contact"> Contact Us</NavbarLinkExtended>
          <NavbarLinkExtended to="/about"> About Us</NavbarLinkExtended>
        </NavbarExtendedContainer>
      )}
    </NavbarContainer>
  );
};

export default Navbar;
